import React from 'react';
import {MobileView, BrowserView} from "react-device-detect";

class Home extends React.Component {
    componentDidMount() {
    }

    render() {
        return (
                    <div className="site-section bg-image-home overlay" style={{ position: 'relative' }}>
                        <BrowserView>
                            <br/><br/><br/><br/>
                            <Container fluid className="h-100">
                                <Row className="justify-content-center align-items-center no-gutters h-100">
                                    <Col xs="12" sm="12" md="10" lg="6">
                                        <Card style={{ fontSize: 'small' }} className={'homeCard'}>
                                            <Card.Body>
                                                <Row style={{ textAlign: 'center', margin: '50px', fontFamily: 'Poppins' }}>
                                                    <Col>
													<span style={{ fontSize: '27px', color: '#4A4A4A' }}>
													{intl.formatMessage({id: 'home.heading'})}
													</span>
                                                        <br />
                                                        <br/>
                                                        <span style={{ fontSize: '18px', color: '#6C6C6C' }}>
														{intl.formatMessage({id: 'home.subHeading'})}
													</span>
                                                    </Col>
                                                </Row>
                                                <Row style={{ marginBottom: '40px' }}>
                                                    <Col md={4}>
                                                        <Nav.Link
                                                            as={Link}
                                                            to="/meetnow"
                                                            style={{ textAlign: 'center' }}
                                                            className="nav-link-home"
                                                        >
                                                            <img
                                                                src={meetnow}
                                                                style={{ padding: '7px', marginBottom: '40px' }}
                                                            />
                                                            <br/>
                                                            <div
                                                                className={'optionsTitle'}
                                                                style={{ marginBottom: '48px' }}
                                                            >
                                                                <span> {intl.formatMessage({id: 'home.meetNow'})}</span>
                                                            </div>
                                                        </Nav.Link>
                                                    </Col>
                                                    <Col md={4}>
                                                        <Nav.Link
                                                            as={Link}
                                                            to="/scheduleMeeting"
                                                            style={{ textAlign: 'center' }}
                                                            className="nav-link-home"
                                                        >
                                                            <img
                                                                src={schedule}
                                                                style={{ padding: '7px', marginBottom: '30px' }}
                                                            />
                                                            <br />
                                                            <div
                                                                className={'optionsTitle'}
                                                                style={{ marginBottom: '40px' }}
                                                            >
                                                                <span>{intl.formatMessage({id: 'home.schedule'})}</span>
                                                            </div>
                                                        </Nav.Link>
                                                    </Col>
                                                    <Col md={4}>
                                                        <Nav.Link
                                                            as={Link}
                                                            to="/joinRoom"
                                                            style={{ textAlign: 'center' }}
                                                            className="nav-link-home"
                                                        >
                                                            <img
                                                                src={joinMeeting}
                                                                style={{ padding: '7px', marginBottom: '40px' }}
                                                            />
                                                            <br />
                                                            <div
                                                                className={'optionsTitle'}
                                                                style={{ marginBottom: '57px' }}
                                                            >
                                                                <span> {intl.formatMessage({id: 'home.joinMeeting'})}</span>
                                                            </div>
                                                        </Nav.Link>
                                                    </Col>
                                                </Row>
                                            </Card.Body>
                                        </Card>
                                    </Col>
                                </Row>
                            </Container>
                        </BrowserView>
                    </div>
        );
    }
}

export default Home;
